import React from "react";
import styled from "styled-components";

const Brands = () => {
    return (
        <BoxSection>
            <WrapperContent>
                <Content>
                    <Title>Horizontal Logo</Title>
                    <WrapperLogo>
                        <BrandLogo>
                            <BackgroundImg>
                                <img
                                    src="../images/contributor-page/orbit-background.svg"
                                    alt=""
                                />
                            </BackgroundImg>
                            <LogoImg>
                                <img
                                    src="../images/logo/logo-forbitspace-dark.png"
                                    alt=""
                                />
                            </LogoImg>
                            <LinkImg>
                                <a href="/">.svg</a> <a href="/">.png</a>
                            </LinkImg>
                        </BrandLogo>
                        <BrandLogo></BrandLogo>
                        <BrandLogo></BrandLogo>
                        <BrandLogo></BrandLogo>
                    </WrapperLogo>
                </Content>
                <Content></Content>
                <Content></Content>
                <Content></Content>
            </WrapperContent>
        </BoxSection>
    );
};

const BoxSection = styled.section`
    position: relative;
    padding: 8vh 0 0;
    margin: 0 0 2rem;
    @media (max-width: 770px) {
        padding-top: 60px;
        margin: 0 0 1rem;
    }
`;
const WrapperContent = styled.div``;
const Content = styled.div``;
const Title = styled.div`
    font-size: 28px;
    font-weight: 200;
`;
const WrapperLogo = styled.div`
    width: 100%;
    display: flex;
    align-items: center;
    justify-content: center;
    gap: 2rem;
`;
const BrandLogo = styled.div`
    max-width: 450px;
    /* background-color: #0c3d68; */

    padding: 1rem;
    border-radius: 16px;
    display: flex;
    align-items: center;
    justify-content: center;

    position: relative;
`;
const LogoImg = styled.div`
    max-width: 250px
    position: absolute;
`;
const BackgroundImg = styled.div`
    top: 0;
    left: 0;
    bottom: 0;
    right: 0;
`;
const LinkImg = styled.div`
    position: absolute;
    left: 1rem;
    bottom: 1rem;
    a {
        text-decoration: none;
    }
`;

export default Brands;
